/*Table structure for table `sc_fileinfo` */

DROP TABLE IF EXISTS `sc_fileinfo`;

CREATE TABLE `sc_fileinfo` (
  `id` varchar(32) COLLATE utf8_unicode_ci NOT NULL,
  `path` varchar(2048) COLLATE utf8_unicode_ci DEFAULT NULL,
  `currname` varchar(2048) COLLATE utf8_unicode_ci DEFAULT NULL,
