  `id` varchar(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键',
  `code` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '编码',
  `name` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '名称',
  `typeid` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '类型',
