/*Table structure for table `sc_frame` */

DROP TABLE IF EXISTS `sc_frame`;

CREATE TABLE `sc_frame` (
  `id` varchar(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键',
  `code` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '编码',
  `name` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '名称',
  `typeid` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '类型',
  `bytesinfo` longblob COMMENT '框架设计Base64编码',
  `type` int(11) DEFAULT NULL,
  `updateuser` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '框架最后修改人',
  `updatetime` datetime DEFAULT NULL COMMENT '框架最后修改时间',
  `systemuptime` datetime DEFAULT NULL COMMENT '系统更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='通用框架';

