/*Table structure for table `sc_logicparam` */

DROP TABLE IF EXISTS `sc_logicparam`;

CREATE TABLE `sc_logicparam` (
  `id` varchar(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键',
  `lmid` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '方法ID',
  `name` varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '方法类型',
  `init` varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '初始化变量',
  `remark` varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '说明',
  `lp_index` int(11) NOT NULL AUTO_INCREMENT COMMENT '排序(不要手工改动)',
  PRIMARY KEY (`id`),
  KEY `index` (`lp_index`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='业务参数';

