/*Table structure for table `sc_platform` */

DROP TABLE IF EXISTS `sc_platform`;

CREATE TABLE `sc_platform` (
  `id` varchar(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '平台ID',
  `name` varchar(512) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '平台名称',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='平台列表';

/*Data for the table `sc_platform` */

insert  into `sc_platform`(`id`,`name`) values ('root','系统配置平台'),('SP_201501090004','业务平台'),('SP_201501220001','生产平台'),('SP_201504120001','教学平台'),('SP_201604190001','OA平台'),('SP_2018012917390001','酒店管理');

/*Table structure for table `sc_query` */

DROP TABLE IF EXISTS `sc_query`;

CREATE TABLE `sc_query` (
  `id` varchar(32) COLLATE utf8_unicode_ci NOT NULL COMMENT '主键',
  `code` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '编码',
  `name` varchar(256) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '名称',
  `typeid` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '类型',
  `bytesinfo` longblob COMMENT '列表设计Base64编码',
  `type` int(11) DEFAULT NULL,
  `updateuser` varchar(32) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '列表最后修改人',
  `updatetime` datetime DEFAULT NULL COMMENT '列表最后修改时间',
  `systemuptime` datetime DEFAULT NULL COMMENT '系统更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='通用查询';

